import React from 'react'
import './Card.css';

const Card = (props) => {
  return (
    <div className='card'>
      {props.person.name}
      {props.person.birthday}
      {props.person.favoriteFoods.meats.forEach(element => {element})}
      {props.person.favoriteFoods.fish.forEach(element => {element})}
    </div>
  )
}

export default Card
